import React, { Component } from 'react'
import Navbar from '../Navbar'

class AllShop extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Header />
        <Modal />
        <br/>
        <br/>
        <br/>
        <Product />
        <Fffooter />
      </div>
    )
  }
}

export default AllShop
